import React, {useEffect, useMemo, useRef, useState} from "react";
import "./styles/App.css";
import {BrowserRouter, Router} from "react-router-dom";
import About from "./pages/About";


const App = () => {
    return (
        <BrowserRouter>
            <Router path="/about">
                <About/>
            </Router>
        </BrowserRouter>
    )
}


export default App;
